import React from "react";
import 
{ BroswerRouter as router, 
  Switch, 
  Route, 
  Link, 
  useRouteMatch, 
  useParams } from 'react-router-dom'



class Work extends React.Component {
  render() {

    return (
      <Router>
      <div className="workDiv">
        <div className="workDivInner">
          <div className="workContainer">
            <div className="workHolder">
              <div className='workItem'><Link to='/Marvelapp'>work 1</Link>`</div>
              <div className='workItem'>Work 2</div>
              <div className='workItem'>Work 3</div>
              <div className='workItem'>Work 4</div>
              <div className='workItem'>Work 5</div>
              <div className='workItem'>Work 6</div>
            </div>
          </div>
        </div>
      </div>
      <Switch>
        <Route path='Marvelapp'>
          <Marvelapp />
        </Route>
      </Switch>
      </Router>
    );
  };
};


export default Work;
